INSERT INTO `ca_survey_questioner` VALUES (1,1,1,'Has your company identified a specific business reason for moving to the cloud',1,_binary '',NULL,NULL),(2,1,1,'Has your company developed a business case for moving to the cloud, and if so, is your business case based on multiple, credible and quality sources',1,_binary '',NULL,NULL),(3,1,2,'Is there a compelling event and timeframe driving the change?',1,_binary '',NULL,NULL),(4,1,2,'Have you had previous experience with Cloud Migration?',1,_binary '',NULL,NULL),(5,2,1,'Has your organization assigned a manager or executive to be responsible for your cloud adoption efforts (single threaded leader). This person overseas a dedicated cloud team (Cloud Center of Excellence) with assigned roles, timelines and resources for adopting cloud services?',1,_binary '',NULL,NULL),(6,2,1,'Does the IT organization engage regularly with their stakeholders to address service and governance issues',1,_binary '',NULL,NULL),(7,2,2,'Have you implemented an organizational change management and training plan for cloud adoption',1,_binary '',NULL,NULL),(8,2,2,'Do you have any cloud migration experience or expertise inhouse?',1,_binary '',NULL,NULL),(9,3,2,'Is there a system or mechanism to track inventory and manage your portfolio of applications and infrastructure (e.g. a configuration management database)',1,_binary '',NULL,NULL),(10,3,2,'Does the organization have at least 12-months of project delivery experience with Agile Frameworks (e.g. SCRUM)',1,_binary '',NULL,NULL),(11,3,1,'Has the organization established a DevOps practice, or does it plan to deliver and manage cloud based services?',1,_binary '',NULL,NULL),(12,4,1,'Has your organization decided who will own operations of cloud based applications and systems (e.g. operational models for deployments and updates)',1,_binary '',NULL,NULL),(13,4,1,'Has the future state operating model for cloud been defined',1,_binary '',NULL,NULL),(14,4,1,'Have you architected, planned or created a baseline  account structure (how will you manage your cloud accounts) and control environments (networking, IAM, etc) that support your core business, security and compliance needs (e.g. AWS Landing Zone)',1,_binary '',NULL,NULL),(15,4,2,'Has the organization communicated a plan to address business continuity or disaster recovery in the cloud',1,_binary '',NULL,NULL),(16,4,1,'What are your Recovery Point Objective and Recovery Time ObjectiveÃ¢â¬â¢s for the service?',1,_binary '',NULL,NULL),(17,5,1,'Does the organization have a strong understanding of operating securely in the cloud?',1,_binary '',NULL,NULL),(18,5,1,'Is anyone in the organization certified by AWS and/or considered an expert or authority on cloud security',1,_binary '',NULL,NULL),(19,5,2,'Does the organization have a documented cloud security plan or methodology',1,_binary '',NULL,NULL),(20,5,1,'Does the organizations leadership for IT Security approve of and participates in creating the cloud adoption strategy or planning sessions',1,_binary '',NULL,NULL),(146,6,3,'What is the application ID',2,_binary '','2021-03-17 17:35:14','2021-03-17 17:35:14'),(147,6,3,'What is the application name',2,_binary '','2021-03-17 17:35:14','2021-03-17 17:35:14'),(148,6,1,'Does Applciation Needs 24/7 Support',2,_binary '','2021-03-17 17:35:14','2021-03-17 17:35:14'),(149,6,3,'Which Line of Business (LoB) or Functional Group this application belongs to?',2,_binary '','2021-03-17 17:35:14','2021-03-17 17:35:14'),(150,6,1,'Are any major upgrades or enhancements planned for this year?',2,_binary '','2021-03-17 17:35:14','2021-03-17 17:35:14'),(151,6,1,'Is the application commercial off-the shelf software package or custom developed',2,_binary '','2021-03-17 17:35:15','2021-03-17 17:35:15'),(152,6,1,'How often are the non-production environments (dev, test, QA) being used for this application?',2,_binary '','2021-03-17 17:35:15','2021-03-17 17:35:15'),(153,7,1,'Are you considering any market-available SaaS options to replace (or as an alternative to) this application or capability within your organization? If so, please provide details of the vendor(s) considered.',2,_binary '','2021-03-17 17:35:15','2021-03-17 17:35:15'),(154,7,1,'Is the application classified as a Legacy Application deployed on old software/hardware that requires upgradation or changes as part of the transformation?',2,_binary '','2021-03-17 17:35:15','2021-03-17 17:35:15'),(155,8,1,'How critical is this application',2,_binary '','2021-03-17 17:35:15','2021-03-17 17:35:15'),(156,8,1,'How do you describe the business criticality of the application? Please provide any further qualitative information that indicates the criticality of the application.',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(157,8,1,'Please identify the level of confidentiality of the data used within the application; and provide any additional information that prohibits migration to Cloud.',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(158,8,1,'Does the application core components allow \"Bring Your Own License\" model while migrating to Public Cloud(s)?',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(159,9,1,'Please mention the application retirement timeline, if the application is identified as a \"to be retired\" application as part of your portfolio assessment(s).',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(160,9,1,'Is application supportable on virtual infrastructure? If not, please describe the affinity towards on-premise physical infrastructure (like PLCs, sensors, kiosks, etc..) and any other related information.',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(161,9,1,'Application Hosted environment',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(162,9,1,'Is it a Web application?',2,_binary '','2021-03-17 17:35:16','2021-03-17 17:35:16'),(163,9,1,'What type of application server is being used?',2,_binary '','2021-03-17 1